column8:
可愛くてオススメ！耐熱ガラス食器♪<br>
<br>
★便利な耐熱ガラス製<br>
・温度変化に強く、熱割れしにくい。<br>
・汚れや匂いが付きにくく、衛生的でお手入れ簡単。<br>
・酸や塩分に強く、梅干しやレモンなどの食品を<br>
　入れても浸食されません。<br>
<br>
★電子レンジＯＫ！<br>
※空だきや冷蔵庫から取り出した直後にレンジ加熱する等は、<br>
急激な温度変化で破損する場合があります。<br>
危険ですので絶対にしないでください。<br>
・オーブン、グリル、直火、食洗機は不可です。<br>
<br>
★丁寧なハンドメイドグラス<br>
・職人が一つずつ丁寧に心を込めて作ったグラスです。<br>
※強化ガラスではありませんので、お取り扱いの際は<br>
丁寧にお使いください。<br>
ガラスは割れ物です。洗浄の際等は十分お気を付け下さい。<br>
<br>
○容　量：280ml<br>
○商品サイズ：約120×90×87mm（持ち手含む）<br>
<br>
○品質表示<br>
品名：耐熱ガラス製器具<br>
使用区分：熱湯用<br>
耐熱温度：120度<br>
<br>
●中国製<br><br><style>
.section {
	margin-bottom:30px;
}

.catch_copy h1 {
	font-size:14px;
}

#rakutenLimitedId_aroundCart,
#rakutenLimitedId_cart {
	width:420px;
}

#rakutenLimitedId_cart {
	border-top:2px solid #555555;
	border-bottom:2px solid #555555;
	border-left:1px solid #ffffff;
	border-right:1px solid #ffffff;
	border-spacing:0!important;
	padding:0 10px;
	background:#ffffff;
	/*width:100%;*/
	margin-bottom:20px;
}


#rakutenLimitedId_cart td {
	vertical-align:middle;
}

#rakutenLimitedId_cart .price1 {
	background:#FA5659;
	color:#ffffff;
	font-size:14px;
	padding:4px 10px;
	display:block;
	text-align:center;
}

#rakutenLimitedId_cart .price2 {
	padding-left:8px;
	font-size:30px;
}

#rakutenLimitedId_cart .tax_postage,
#rakutenLimitedId_cart .price2 {
/*	vertical-align:bottom;*/
}

td.inventory_choice_name {
	background:#E8E8D7!important;
	padding:8px 0;
}

#rakutenLimitedId_cart td {
	padding:10px 0;
	background:#ffffff;
	border:1px solid #ffffff;
}

#rakutenLimitedId_aroundCart table {
	width:100%;
}

.inventory_title {
	display:none;
}


/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
  width: 420px;
  height: 70px;
  background:url(http://www.rakuten.ne.jp/gold/piccolocarino/img/common/cart_in.gif) center center #ff8003 no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer !important;
  text-indent: 150%;
  white-space: nowrap;
  margin: 5px 0 0 0;
  display:block;
}

#rakutenLimitedId_aroundCart .inventory input {
  background:none !important;
  width: 2em!important;
  height: 1.2em!important;
  display:inline;
}

/*個数テキスト*/
#rakutenLimitedId_aroundCart .unit {
  font-size:24px;
  padding:10px;
}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
  border:solid #ccc 1px;
  background:#fff!important;
  width:36px;
  height:36px;
  cursor:auto;
  padding:7px 7px 7px 3px;
  text-indent: 0px;
  overflow: hidden;
  display:inline;
  font-size:22px;
  text-align:center;
}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
  width: 420px;
  height: 43px;
  background:url(http://www.rakuten.ne.jp/gold/piccolocarino/img/common/contact_item.gif) center center#beb9b4 no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer !important;
  text-indent: 150%;
  white-space: nowrap;
  margin: 5px 0 0 0;
  display:block;
}

/*Bookmark*/
#serviceTableSml .favorite {
  display:block;
  width: 420px;
}


#serviceTableSml .favorite #bookmarkArea_0 div{
width: 420px!important;
}

#serviceTableSml .favorite .bkm a {
  width: 420px!important;
  height: 122px!important;
  background:url(http://www.rakuten.ne.jp/gold/piccolocarino/img/common/like_item.gif) #d8fbfd no-repeat;
  overflow: hidden;
  border-width: 0px;
  cursor: pointer !important;
  text-indent: 150%;
  margin: 5px 0 0 0;
  display:block;
}

#serviceTableSml .favorite td.review a.see {
	padding-left:15px!important;
	background:none;
}

.riMb10 td.review {
	padding:15px!important;
	border:1px solid #bfbfbf!important;
}

td.mail {
	padding:0 15px 15px!important;
	border:1px solid #bfbfbf!important;
}

td.mail ul {
	padding:5px 0 0 0!important;
}
/*----------ssBnr---------------------------*/
div.ssBnr {
	margin-right:-10px;
background:#3bd0d2;
}

div.ssBnr ul {
    padding-left:10px;
}

div.ssBnr ul li {
	float:left;
	margin-bottom:10px;
}

div.ssBnr ul li.harfBnr {
	width:340px;
	margin-right:10px;
}

/*----------selectionBnr---------------------------*/
div.selectionBnr {
	margin-right:-12px;
}

div.selectionBnr ul {
width:710px;
margin:0;
padding:0;
list-style:none;
}
div.selectionBnr ul li {
	float:left;
	margin-bottom:10px;
}

div.selectionBnr ul li.harfBnr {
	width:349px;
	margin-right:12px;
}

</style>


